import React, { useState } from "react";
import { useNavigate } from "react-router-dom";
import espressoImg from "./assets/espresso.png";
import refresherImg from "./assets/refreshercoffee.png";
import teaImg from "./assets/teacoffee.png";
import blendedImg from "./assets/chocolate.png";
import pastryImg from "./assets/pastry.png";
import CartIcon from "./CartIcon";
import "./App.css";

export default function CoffeeShop({ addToCart, totalItems }) {
  const navigate = useNavigate();
  const [menuOpen, setMenuOpen] = useState(false);

  const toggleMenu = () => setMenuOpen((open) => !open);

  // Put your styles here (copied from your original code)
  const buttonStyle = { /* ... */ };
  const buttonHoverStyle = { /* ... */ };
  const imgStyle = { /* ... */ };
  const labelStyle = { /* ... */ };
  const floatingMenuStyle = { /* ... */ };
  const hiddenStyle = { /* ... */ };
  const visibleStyle = { /* ... */ };
  const menuButtonStyle = { /* ... */ };

  const products = [
    { key: "espresso", label: "Espresso", img: espressoImg, area: "espresso" },
    { key: "refresher", label: "Refresher", img: refresherImg, area: "refresher" },
    { key: "tea", label: "Tea", img: teaImg, area: "tea" },
    { key: "pastry", label: "Pastry", img: pastryImg, area: "pastry" },
    { key: "blended", label: "Blended Beverage", img: blendedImg, area: "blended" },
  ];

  return (
    <div style={{ textAlign: "center", paddingBottom: "80px" }}>
      {/* Product grid (unchanged) */}
      <div
        style={{
          display: "grid",
          gridTemplateColumns: "1fr 1fr 1fr 1fr 1fr",
          gridTemplateRows: "auto auto",
          gridTemplateAreas: `
            ". espresso refresher tea ."
            ". . pastry blended ."
          `,
          maxWidth: "100%",
          margin: "1rem auto",
          gap: "2rem 2rem",
          padding: "0 1rem",
          background: "none",
        }}
      >
        {products.map(({ key, label, img, area }) => (
          <div
            key={key}
            style={{
              gridArea: area,
              justifySelf: "center",
              alignSelf: "center",
              display: "flex",
              flexDirection: "column",
              alignItems: "center",
            }}
          >
            <button
              onClick={() => navigate(`/${key}`)}
              style={{
                ...buttonStyle,
                // Add hover style if needed
              }}
              aria-label={label}
              title={label}
            >
              <img src={img} alt={label} style={imgStyle} />
              <div style={labelStyle}>{label}</div>
            </button>
          </div>
        ))}
      </div>

      {/* Floating menu bottom right */}
      <div style={floatingMenuStyle}>
        {/* Back button */}
        <button
          onClick={() => {
            navigate("/");
            setMenuOpen(false);
          }}
          aria-label="Back to Home"
          title="Back to Home"
          style={{
            ...menuButtonStyle,
            width: "50px",
            height: "50px",
            background: "#eee",
            color: "#5a3e1b",
            boxShadow: "0 2px 6px rgba(0,0,0,0.15)",
            ...(!menuOpen ? hiddenStyle : visibleStyle),
          }}
        >
          {/* Back arrow SVG */}
          <svg
            xmlns="http://www.w3.org/2000/svg"
            width="24"
            height="24"
            fill="none"
            stroke="currentColor"
            strokeWidth="2"
            strokeLinecap="round"
            strokeLinejoin="round"
            viewBox="0 0 24 24"
          >
            <polyline points="15 18 9 12 15 6" />
          </svg>
        </button>

        {/* Cart icon navigates to /cart page */}
        <div
          onClick={() => navigate("/cart")}
          style={{
            ...(!menuOpen ? hiddenStyle : visibleStyle),
            transitionDelay: menuOpen ? "0.1s" : "0s",
            cursor: "pointer",
            outline: "none",
          }}
          aria-label="Go to Cart"
          title="Go to Cart"
          role="button"
          tabIndex={0}
          onKeyDown={(e) => {
            if (e.key === "Enter" || e.key === " ") {
              e.preventDefault();
              navigate("/cart");
            }
          }}
        >
          <CartIcon totalItems={totalItems} />
        </div>

        {/* Menu toggle button */}
        <button
          onClick={toggleMenu}
          aria-label={menuOpen ? "Close menu" : "Open menu"}
          title={menuOpen ? "Close menu" : "Open menu"}
          style={menuButtonStyle}
        >
          {menuOpen ? (
            /* X icon SVG */
            <svg
              xmlns="http://www.w3.org/2000/svg"
              width="24"
              height="24"
              fill="none"
              stroke="currentColor"
              strokeWidth="2"
              strokeLinecap="round"
              strokeLinejoin="round"
              viewBox="0 0 24 24"
            >
              <line x1="18" y1="6" x2="6" y2="18" />
              <line x1="6" y1="6" x2="18" y2="18" />
            </svg>
          ) : (
            /* Hamburger icon SVG */
            <svg
              xmlns="http://www.w3.org/2000/svg"
              width="24"
              height="24"
              fill="none"
              stroke="currentColor"
              strokeWidth="2"
              strokeLinecap="round"
              strokeLinejoin="round"
              viewBox="0 0 24 24"
            >
              <line x1="3" y1="12" x2="21" y2="12" />
              <line x1="3" y1="6" x2="21" y2="6" />
              <line x1="3" y1="18" x2="21" y2="18" />
            </svg>
          )}
        </button>
      </div>
    </div>
  );
}
